import useUsers from "../../store/user";


const API_KEY = process.env.REACT_APP_API_KEY;
function User() {
    const { users, execute} =useUsers(state => state);

    console.log(API_KEY,process.env.DB_HOST);
    return(
        <div>
            <button onClick={() => execute(`https://jsonplaceholder.typicode.com/${process.env.USER}`)}> call api </button>
           <div>
               {users.map((user) =>{
                   return <div>{user.name}</div>
               })}
           </div>

        </div>
    )
}

export default  User;
